import React from "react";
import { useContext } from "react";
import { AuthContext } from "../context/auth.context";

const Exit = () => {
    const { logout } = useContext(AuthContext);
    return (
        <button className="exit" onClick={() => logout}>
            <div className="inExit">
                OUT
            </div>
        </button>
    )
}

export default Exit;
